pragma solidity 0.4.24;

import "./ZBGCard.sol";

// ZBGCard + functions required to migrate the user data from the old version
// Should be as trustless as possible
contract MigratedZBGCard is ZBGCard {

    bool migrated = false;
    event MigrationStopped();

    // Constructor
    constructor (
        address _gateway,
        address[] _validators,
        uint8 _threshold_num,
        uint8 _threshold_denom
    ) public ZBGCard(_gateway, _validators, _threshold_num, _threshold_denom) {}


    // Validator wants to distribute tokens
    function migrateTokens(uint256[] _tokenIds, address[] _receivers, uint256[] _amounts) external
        onlyValidator
    {
        require(!migrated, "data has been migrated already");

        uint256 length = _tokenIds.length;
        require(length == _amounts.length && length == _receivers.length,
                "Invalid array lengths"
        );

        for (uint256 i = 0; i < length; i++) {
            _claimToken(_tokenIds[i], _receivers[i], _amounts[i]);
        }
    }

    function stopMigration() external {
        migrated = true;
        emit MigrationStopped();
    }
}
